import './App.css';
import { BrowserRouter, Routes, Route, NavLink } from 'react-router-dom';
import Dashboard from "./components/dashboard";
import CreateTask from "./components/create_task";
import Edit from "./components/edit";
import AddRecipe from "./components/AddRecipe";
import RecipeDetails from "./components/recipe_etails";
import Profile from "./components/profile"; // Assuming you have a Profile component

function App() {
  return (
    <BrowserRouter>
      <div className="container">
        {/* Navbar */}
        <nav className="navbar">
          <ul>
            <li>
              <NavLink to="/" className={({ isActive }) => isActive ? "active" : ""}>Home</NavLink>
            </li>
            <li>
              <NavLink to="/dashboard" className={({ isActive }) => isActive ? "active" : ""}>Dashboard</NavLink>
            </li>
            <li>
              <NavLink to="/assignments" className={({ isActive }) => isActive ? "active" : ""}>Tasks</NavLink>
            </li>
          </ul>
        </nav>

        {/* Home Page Buttons */}
        <div className="home-buttons">
          <button onClick={() => window.location.href = "/dashboard"}>Go to Dashboard</button>
          <button onClick={() => window.location.href = "/profile"}>Go to Profile</button>
        </div>

        {/* Routes */}
        <div className="content">
          <Routes>
            <Route path="/" element={<div>Welcome to Study Planner</div>} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/assignments" element={<CreateTask />} />
            <Route path="/edit/:id" element={<Edit />} />
            <Route path="/addrecipe" element={<AddRecipe />} />
            <Route path="/recipe/:id" element={<RecipeDetails />} />
            <Route path="/profile" element={<Profile />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
